import React from 'react';
import Head from 'next/head';
import Layout from '../components/Layout';

const Home = () => {
    return(
        <>
        <Layout>
            <Head>
                <title>About</title>
            </Head>    
            <h1>Home</h1>  

             <style jsx>{`
                body{
                    background: #592751;
                }
            
            `}</style>     
        </Layout>
        </>
    )
}
export default Home;
